import { useState } from "react";

function Header() {
  return <></>;
}

function Footer() {}

function Items() {}

function Item(id, title, currentBalance, budgetBalance) {
  let width = currentBalance / budgetBalance;
  if (width > 99) width = 100;
  return (
    <>
      <div id={id + "Title"} key={id + "Title"}>
        {title}
      </div>
      <div id={id + "Balance"} key={id + "Balance"}>
        {currentBalance + " of " + budgetBalance}
      </div>
      <div id={id + "BarCurrent"} key={id + "BarCurrent"} width={width}>
        {currentBalance} of{" "}
      </div>
      <div id={id + "BarBudget"} key={id + "BarBudget"} width={100 - width}>
        {budgetBalance}
      </div>
    </>
  );
}

function Budget() {
  return (
    <div>
      <Header key="1" />
      <Items key="2" />
      <Footer key="3" />
    </div>
  );
}

const accounts = [
  { id: 1, current: 150, budget: 300, name: "Auto" },
  { id: 2, current: 1500, budget: 1500, name: "Home loan" },
  { id: 3, current: 750, budget: 1000, name: "Groceries" },
  { id: 4, current: 250, budget: 300, name: "Travel" },
  { id: 5, current: 500, budget: 400, name: "Misc" },
];

export default function App() {
  return <Budget />;
}
